  ///
  /// Returns a BoolCommitResult
  Future<BoolCommitResult> upsertAll(List<Author> authors) async {
    final results = await _mnAuthor.rawInsertAll(
        'INSERT OR REPLACE INTO authors (id, name)  VALUES (?,?)', authors);
    return results;
  }

